INSERT INTO `prd` (`prdprd`, `prdcod`, `prdnom`, `prddes`, `prdimg`, `prdcat`, `prdfec`, `prdprv`) VALUES
	(6, '388', 'Tubo Leukoplast', 'Tubo Leukoplast\r\n\r\nTela adhesiva de acetato con adhesivo en una de sus caras', 'http://medicaalejo.com.mx/wp-content/uploads/2015/10/KNR_LEUKOPLASTphotoshop.jpg', 1, '2015-10-07 01:44:36', 0);
INSERT INTO `prd` (`prdprd`, `prdcod`, `prdnom`, `prddes`, `prdimg`, `prdcat`, `prdfec`, `prdprv`) VALUES
	(7, '387', 'Suturas Atramat Polidioxanona', 'La Polidioxanona es no antigénica y no pirogénica produciendo solamente una ligera reacción durante su absorción. Sutura sintética monofilamento absorbible de color violeta e incolora. Las suturas de Polidioxanona están indicadas para la aproximación de tejidos blandos, incluyendo el uso pediátrico en los tejidos cardiovasculares, en microcirugía y cirugía oftálmica. Este tipo de suturas es útil principalmente cuando se desea una combinación de sutura absorbible y un soporte prolongado de la herida (hasta seis meses).', '', 1, '2015-10-07 01:41:01', 0);
INSERT INTO `prd` (`prdprd`, `prdcod`, `prdnom`, `prddes`, `prdimg`, `prdcat`, `prdfec`, `prdprv`) VALUES
	(8, '386', 'Suturas Atramat Nylon', 'Suturas de Nylon\r\n\r\nSe elabora a partir de poliamidas de primera calidad. Es una sutura sintética monofilamento no absorbible. Reconocida por ser inerte, por sus propiedades capilares y por su excelente fuerza tensil y suave paso por los tejidos. Ideal en procedimientos que se requieren resultados. cosméticos y que sea tolerado por el tejido. Colores azul y negro que permiten mayor visibilidad. -', '', 1, '2015-10-07 01:31:38', 0);
INSERT INTO `prd` (`prdprd`, `prdcod`, `prdnom`, `prddes`, `prdimg`, `prdcat`, `prdfec`, `prdprv`) VALUES
	(9, '385', 'Suturas Atramat Catgut Simple CS', 'Catgut Simple CS.\r\n\r\nSutura multifilamento absorbible de origen animal. Pulida electrónicamente bajo el más riguroso control de fabricación. Brinda una resistencia óptima durante todo el proceso de cicatrización. -', '', 1, '2015-10-07 01:29:43', 0);
INSERT INTO `prd` (`prdprd`, `prdcod`, `prdnom`, `prddes`, `prdimg`, `prdcat`, `prdfec`, `prdprv`) VALUES
	(10, '383', 'Suturas Atramat Catgut Crómico', 'Catgut Crómico\r\n\r\nSutura multifilamento absorbible de origen animal.\r\nCon colágeno de alta pureza.\r\nBrinda una resistencia óptima durante todo el proceso de cicatrización.\r\nCon proceso de cromado antes de ser torcido.\r\nCalibrado y pulido uniforme.', 'http://medicaalejo.com.mx/wp-content/uploads/2015/10/AtramatSuturas2.jpg', 1, '2015-10-07 01:27:06', 0);
